  input: "\"TEXT\",\"F3XN\",\"C00140590\",\"March 20, 2007\t\t    Laura S.  Federal
    Elections Commission    RE:  California Republican Party           FEC ID#  C00140590
    \          March Monthly Report (02/01/07-02/28/07)              Dear Laura S,
    \   The transfers shown reflect variations due to timing of transfers based upon
    reimbursements from the non-federal and Levin accounts the federal account at
    different points in the 70-day window provided in Reg. 10-6.7(f)(2).  No transfers
    were made outside the 70-day window.      Our filing software would not allow
    us to detail information pertaining to receipts on Line 15 of our report. The
    offset to operating expenditures for Cobraserv National Service Center were Health
    Care Reimbursements. The offsets for Verizon California were overpayments on telephone
    bills. In regards to the offset for Southern California Edison, the committee
    overpaid an electric bill. The offsets from the US Postmaster were postage reimbursements.
    St. Monicas Church purchased a computer from the committee and we reflect the
    payment on line 15. The committee was also reimbursed by Fedex for excess shipping
    costs.      The partys non federal account did not have sufficient funds to pay
    what was strictly a non federal payroll (0% Federal Activity). Thus, the federal
    account transferred $120,000 to enable the non federal account to pay the purely
    non federal expense.     In regard to occupation and employer information requested,
    a letter is sent to those donors whose contributions exceed $200, but did not
    provide us with their employer and occupation on our initial contribution solicitation
    which sites the FEC regulation for the requested information.  The committees
    policy is to send a follow-up letter within thirty days of the original contribution
    to request this information with a pre-addressed envelop enclosed for the return
    of such information.  All such information received is reported accordingly.  If
    information is received after the reporting deadline, the committee will amend
    the appropriate monthly report.        Fred Arjani    \""
